import React, { useState } from "react";
const Divide = () => {
  let Colors = "0123456789ABCDEF";
  const [color, setColor] = useState("#");
  const styles = {
    width: "350px",
    height: "300px",
    backgroundColor: "yellow",
    border: "2px solid black",
  };
  return <div style={styles}></div>;
};
export default Divide;
